import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    IconButton,
    Box,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
    Container
  } from "@mui/material";

  function HomePage() {
    return (
      <Container
        fixed
        sx={{
          bgcolor: "grey",
          marginTop: '10vh', 
          marginBottom: '10vh',
          width: "100%",
          height: "100vh",
          display: 'flex', // Use flexbox for layout
          alignItems: 'center', // Vertically center content
          justifyContent: 'space-between', // Space between left and right boxes
        }}
      >
        <Box>
          <h1>Left</h1>
        </Box>
        <Box>
          <h1>Right</h1>
        </Box>
      </Container>
    );
  }

  export default HomePage;
